/* Modulos de librerías */

/* Componentes */
import Header from "../../Components/Header/Header";
import Footer from "../../Components/Footer/Footer";
import Boton from "../../Components/Boton/Boton";
import InputField from "../../Components/InputField/InputFile";

/* Estilos */
import styles from "./Home.module.css";

export default function Home() {
    return (
        <>
          {/*<Header/>*/}
          <Main/>
          {/*<Footer/>*/}
        </>
    );
}

function Main() {
  return (
    <main className={styles["main-container"]}>
      <section className={styles["top-level-section"]}>
        <h1>Inicio de sesión</h1>

        <div className={styles["separator-div"]}>

          <section className = {styles["left-section"]}>
            <h2>Credenciales</h2>
            <form action="" method="POST" className={styles["form-container"]}>

            <InputField id="username-register-form" label="Nombre de usuario" name="username" type="text" />
            <InputField id="password-register-form" label="Contraseña" name="password" type="password" />
            <InputField id="passwordAgain-register-form" label="Repita su contraseña" name="passwordAgain" type="password" />


              <div className={styles["buttons-container"]}>
                <Boton type="submit" onClickFunction={(event) => Debug(event, "Click hecho en Aceptar")}/>
                <Boton type="reset"  onClickFunction={(event) => Debug(event, "Click hecho en Limpiar")}/>
                <Boton/>
              </div>

            </form>
          </section>

          <section className={styles["right-section"]}>
            <h2>Bienvenido</h2>
            <p>¿No tienes una cuenta?</p>
            <a className={styles["button-line-anchor"]}>Regístrate</a>
          </section>
        </div>

      </section>
    </main> 
  );
}

// BORRAR, SOLO PARA TESTING.
function Debug(event, msg) {
  event.preventDefault();
  console.log(msg);
}
